import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a product card to open the modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child');

    // Wait for the product detail modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract product details from the modal
    const productDetails = await page.evaluate(() => {
      const title = document.querySelector('.product-detail-title')?.textContent || '';
      const price = document.querySelector('.product-detail-price')?.textContent || '';
      const rating = document.querySelector('.product-detail-rating .rating-text')?.textContent || '';
      const description = document.querySelector('.product-detail-description p')?.textContent || '';

      return {
        title: title.trim(),
        price: price.trim(),
        rating: rating.trim(),
        description: description.trim()
      };
    });

    return {
      success: true,
      action: "Successfully opened product detail modal by clicking on a product card",
      extractedData: productDetails,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
